Sherlock Bones (Split Scenes / 2012)

When Sherlock Bones' brother, Mycock is found murdered at a sex club it's up to the greatest detective and his trigger happy, sexy sidekick Hotson to find the killer. Sherlock's unusual sexual methods come to light as his investigation brings him deeper into a dangerous plot, orchestrated by his ultimate nemesis, Moriarty. This modern day Sherlock takes the BBC series and gives it the Michael Bay treatment! When the country is in danger and an army of Ninjas threatens the world, you can count on one man to save the day. Just don't call him Shirley.

Jaiden West, Jess West, Lucy Love, Paige Turnah, Rebecca More, Alex Dee, Danny D, Mark Sloan

Hardcore, All Sex

